import axios from "axios";
import { useEffect, useState } from "react";

import { Divider } from "@mui/material";
import Alert from "@mui/material/Alert";
import Box from "@mui/material/Box";
import Grid from "@mui/material/Grid";
import Card from "@mui/material/Card";
import Typography from "@mui/material/Typography";
import DashboardLayout from "examples/LayoutContainers/DashboardLayout";

function ListAllEntries() {
  const [setData] = useState([]);
  useEffect(async () => {
    axios.get("http://localhost:9001/entries/all").then((res) => {
      const threads = res.data;
      setData(threads);
    });
  });

  return (
    <DashboardLayout>
      <Box mt={2} mb={1}>
        <Grid container spacing={1} justifyContent="center">
          <Grid item xs={12} lg={8}>
            <Card>
              <Box p={2}>
                <Typography variant="h5">JSON to Table Test</Typography>
                <Divider>-</Divider>
                <Alert color="success" dismissible="false">
                  <div>
                    <table className="table table-striped">
                      <thead>
                        <tr>
                          <th scope="col">EntryID</th>
                          <th scope="col">Name</th>
                          <th scope="col">CreatedAt</th>
                          <th scope="col">UpdatedAt</th>
                        </tr>
                      </thead>
                      <tbody>
                        {setData.map((entry) => (
                          <tr>
                            <td>{entry.entryId}</td>
                            <td>{entry.name}</td>
                            <td>{entry.createdAt}</td>
                            <td>{entry.updatedAt}</td>
                          </tr>
                        ))}
                      </tbody>
                    </table>
                  </div>
                </Alert>
              </Box>
            </Card>
          </Grid>
        </Grid>
      </Box>
    </DashboardLayout>
  );
}

export default ListAllEntries;
